  false,\n\t\"url\": null,\n\t\"notes\": \"In this report an attempt has been made
  to summarize some of the notes made during the nesting studies at the Lower Souris
  Refuge in 1937. While assisting Mr. Kalmbach in this work, a separate copy of field
  notes was kept by the writer. The information given here will at least be partly
  duplicated when Mr. Kalmbach prepares his notes some time in the future. How-ever,
  this report has been prepared principally for the is on the refuge and as a Divisional
  Repot, rather than for a more general application. Comparisons have been made between
  this year's work and the results of Mr. Kalmbach's studies last year, as well as
  his Canadian Studies, some notes of which were given in the 1936 report left at
  the refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
